export default {
	myVar1: [],
	myVar2: {},
	getNewsHandler: async () => {
		await getNews.run();
		storeValue("news", getNews.data);
	},
	commentOnNews: async () => {
		try {
			await createComment.run();
			getComments.run();
		} catch(err) {
			showAlert(err)
		}
	},
	myFun2: async (data) => {
		let newsObj = {...data, likes: 0, createdAt: Date()};
		createNews.run(newsObj);
		//use async-await or promises
	},
	showModalHandler: () => {
		showModal('Modal1');
		appsmith.store.currNewsId = List1.selectedItem._id;
	},
	searchNewsHandler: async () => {
		if (Search.text.length === 0) {
			await getNews.run();
			storeValue("news", getNews.data);
			return;
		}
		await searchNews.run();
		storeValue("news", searchNews.data);
		//_.debounce(this.searchNewsFn, 500);
	},
	filterByCategory: async () => {
		await getNews.run();
		storeValue("news", getNews.data);
	}
}
